import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import AuthPage from './pages/AuthPage';
import Dashboard from './pages/Dashboard';
import Pages from './pages/Pages';
import Leads from './pages/Leads';
import Payments from './pages/Payments';
import Reports from './pages/Reports';
import Marketing from './pages/Marketing';
import Chatbot from './pages/Chatbot';
import Users from './pages/Users';
import Templates from './pages/Templates';
import { GoogleOAuthProvider } from '@react-oauth/google';
import ErrorBoundary from './components/ErrorBoundary';
import { UserProvider } from './context/UserContext';
import CreateLandingPage from "./components/CreateLanding";
import GioiThieu from "./components/about_public/GioiThieu";
import Background from "./components/Background";

// Component bảo vệ route yêu cầu xác thực
const ProtectedRoute = ({ children }) => {
    const { user } = React.useContext(UserContext); // Giả sử bạn lưu thông tin user trong UserContext
    return user ? children : <Navigate to="/auth" replace />;
};

function App() {
    const clientId = process.env.REACT_APP_GOOGLE_CLIENT_ID;

    return (
        <GoogleOAuthProvider clientId={clientId}>
            <ErrorBoundary>
                <Router>
                    <UserProvider>
                        <Routes>
                            {/* Route công khai */}
                            <Route path="/gioithieu" element={<GioiThieu />} />
                            <Route path="/auth" element={<AuthPage />} />
                            <Route path="/" element={<AuthPage />} />

                            {/* Route yêu cầu xác thực */}
                            <Route
                                path="/dashboard"
                                element={
                                    <ProtectedRoute>
                                        <Dashboard />
                                    </ProtectedRoute>
                                }
                            />
                            <Route
                                path="/pages"
                                element={
                                    <ProtectedRoute>
                                        <Pages />
                                    </ProtectedRoute>
                                }
                            />
                            <Route
                                path="/leads"
                                element={
                                    <ProtectedRoute>
                                        <Leads />
                                    </ProtectedRoute>
                                }
                            />
                            <Route
                                path="/payments"
                                element={
                                    <ProtectedRoute>
                                        <Payments />
                                    </ProtectedRoute>
                                }
                            />
                            <Route
                                path="/reports"
                                element={
                                    <ProtectedRoute>
                                        <Reports />
                                    </ProtectedRoute>
                                }
                            />
                            <Route
                                path="/marketing"
                                element={
                                    <ProtectedRoute>
                                        <Marketing />
                                    </ProtectedRoute>
                                }
                            />
                            <Route
                                path="/chatbot"
                                element={
                                    <ProtectedRoute>
                                        <Chatbot />
                                    </ProtectedRoute>
                                }
                            />
                            <Route
                                path="/users"
                                element={
                                    <ProtectedRoute>
                                        <Users />
                                    </ProtectedRoute>
                                }
                            />
                            <Route
                                path="/templates"
                                element={
                                    <ProtectedRoute>
                                        <Templates />
                                    </ProtectedRoute>
                                }
                            />
                            <Route
                                path="/pages/create"
                                element={
                                    <ProtectedRoute>
                                        <CreateLandingPage />
                                    </ProtectedRoute>
                                }
                            />
                            <Route path="/create-landing" element={<Navigate to="/pages/create" replace />} />
                            {/* Chuyển hướng tất cả các route không xác định về /auth */}
                            <Route path="*" element={<Navigate to="/auth" replace />} />
                        </Routes>
                    </UserProvider>
                </Router>
            </ErrorBoundary>
        </GoogleOAuthProvider>
    );
}

export default App;
